import React from 'react';
import footerStyle from '../../styles/Footer.module.scss'
const Footer = () => {
    return (
        <div className={footerStyle}>
            <div className="row">
                <div className="col-6">
                    <p>
                        LIÊN HỆ VỚI HIỆU
                    </p>
                </div>
                <div className="col-6">
                     
                </div>
            </div>
        </div>
    )
}

export default Footer;
